const SelectReset = (props) => {
  const onClickReset = () => {
    props.reset = false;
  };

  const options = [10, 20, 30, 40, 50];
  return (
    <div style={{ display: "flex" }}>
      <select>
        {options.map((opt) => (
          <option value={opt} key={opt}>
            {opt + " sec"}
          </option>
        ))}
      </select>
      <button onClick={onClickReset}>Reset</button>
    </div>
  );
};

export { SelectReset };
